import css from 'styled-jsx/css';

export default css`.header-content {
  height: 60px;
  line-height: 60px;
}
.header-content .logo {
  display: inline-block;
  font-size: 0px;
  width: 134px;
  height: 33px;
  /* margin: 18px 0; */
  background: url(/static/images/logo.png) no-repeat center center;
  background-size: 100%;
  vertical-align: middle;
}
.header-content .nav {
  float: right;
}
`
